var dbg = document.getElementById("debug");

const WIDTH = 512;
const HEIGHT = 320;
const RATIO = HEIGHT/WIDTH;


var imagem = new Image();
imagem.src = "data:image/png;base64,";
var testTile = new Image();
testTile.src = "data:image/png;base64,";
var DELTATIME = 0;
var then = 0;

var tiles = [];

for(var i=0;i<1024;i++)
	tiles.push(document.createElement("Canvas"));
function loadFramesIntoArray(image, array, frameWid, frameHei){
	var imgsForRow = image.width/frameWid;
	var rows = image.height/frameHei;
	for(var y=0;y<rows;y++){
		for(var x=0;x<imgsForRow;x++){
			var cv = array[y*imgsForRow+x];
			cv.width = frameWid; cv.height = frameHei;
			var ctx = cv.getContext("2d");
			ctx.drawImage(image, x*frameWid, y*frameHei, frameWid, frameHei, 0, 0, frameWid, frameHei);
		}
	}
}



window.onload = function(){
	loadFramesIntoArray(imagem, tiles, 32, 64);
	update(0);
}

var objs = []
for(var i=0;i<4; i++)
	objs.push(createObject({position:[Math.random()*2-1,Math.random()*2-1,0], texture:createTexture(tiles[~~(Math.random()*40)])}));


function update(now){
	DELTATIME = (now-then)*.001;
	then = now;
	dbg.textContent = 1/DELTATIME;
	
	// At init time. Clear the back buffer.
	gl.clearColor(0,1,1,1);
	gl.clear(gl.COLOR_BUFFER_BIT);
	gl.clear(gl.DEPTH_BUFFER_BIT);
	gl.useProgram(program);
	
	//Do tasks... :-)
	for(var i=0;i<4; i++)
		renderObject(objs[i]);
	
	
	// Turn off rendering to alpha
	requestAnimationFrame(update);
}

